    [],nt"revision_timestamp": "2015-12-08T21:04:32.003798",nt"name": "tanzania-mafia-island-airport",nt"isopen":
    false,nt"url": null,nt"notes": " n        The evaluation design and subsequent
    data gathering activities will address the following key research questions:na)
    Has the Mafia Island Airport Upgrade Project contributed to easier, more efficient,
    and safer access to Mafia Island?nb) Has the Mafia Island Airport Upgrade project
    contributed to an increase in (i) tourism and/or (ii) business travel?nc) Has the
    Mafia Island Airport Upgrade project contributed to an increase in visitor spending
    on the island?nd) Has the Mafia Island Airport Upgrade project contributed to an
    increase in economic and investment activities on the island? (Hotel, wildlife refuge,
    food industry, etc.)nnThese are the thematic areas or critical issues for the evaluation.
    Linkage with the Project Logic will be as follows:n- Outcome indicators in the Project
    Logic will be addressed in evaluation question (b) above.n- Objective indicators
    in the Project Logic will be addressed in evaluation questions (c) and (d) above.n-
    The Compact Goal indicator will be part of the evaluation indicators of the project.n-
    The Consultant will also measure the Compact Goal using ownership of assets and
    food poverty as proxy of poverty indicators at micro level because they are used
    by the National Bureau of Statistics (NBS) in Household Budget Survey and Tanzania
    Poverty Monitoring Framework.n      ",nt"license_title": "License Not Specified",nt"extras":
